callbackTimes(Session,QueryName,Updating,JavaCall,Parsing,Deletion,Insertion) :- 
    log(Session,NI,CPUi,framesWereInserted(Updating)), 
    Nd is NI-1, log(Session,Nd,CPUd,framesWereDeleted(_)), 
    Np is NI-2, log(Session,Np,CPUp,framesWereParsed), 
    Nj is NI-3, log(Session,Nj,CPUj,javaMessageReturned), 
    Nc is Nj-1, log(Session,Nc,CPUc,Call), Call ='%getMetaQLQueryResults'(_CONTEXT, _Module, _HandlerClass, QueryName, _Params, _Status), 
    JavaCall is CPUj-CPUc, Insertion is CPUi-CPUd, Parsing is CPUp-CPUj, Deletion is CPUd-CPUp.

printTimes :-
    format("Session\tQueryName\tUpdating\tJavaCall\tParsing\tDeletion\tInsertion~n"),
    callbackTimes(Session,QueryName,Updating,JavaCall,Parsing,Deletion,Insertion),
    format("~w\t~w\t~w\t~w\t~w\t~w\t~w~n",[Session,QueryName,Updating,JavaCall,Parsing,Deletion,Insertion]), fail.
printTimes.

